import React from 'react';
import './App.css';
import {BrowserRouter, Route} from 'react-router-dom';


// components
import Home from "./components/Homepage/Home";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Route exact path="/" component={Home} />
        <Route path="/allSeasons" component={AllSeasonsList} />
      </div>
    </BrowserRouter>
  );
}

export default App;
